const hrStyle = {
  borderTop: '2px solid #14a3bb',
  marginTop: 50,
  //maxWidth: '50%',
  align: 'right', 
};

const h2Style = {
  textAlign: 'center',
  color: '#000',
};

const h6Style = {
  textAlign: 'center',
  color: '#000',
};

const Container = {

  backgroundColor: '#000',
};


const Activation = props => (
  <div id="activation">
    <h2 style={h2Style}>Activation</h2>
    <h6 style={h6Style}>Putting all this knowledge into action, with industry leading results.</h6>

    <hr style={hrStyle}></hr>
  </div>
);

export default Activation;
